import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Landing from './Landing'; // Adjust the import path as needed
import Register from './Register';
import Login from './Login';
import Ticket from './Ticket';
import ShowTickets from './ShowTickets';
import userProfile from './userProfile';
import Navbar from './Navbar'; // Import your custom Navbar if you have one

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App d-flex">
          <Landing />
          <div className="container flex-grow-1">
            <Route exact path="/" component={Landing} />
            <Route exact path="/register" component={Register} />
            <Route exact path="/login" component={Login} />
            <Route exact path="/addTicket" component={Ticket} />
            <Route exact path="/tickets" component={ShowTickets} />
            <Route exact path="/userProfile" component={userProfile} />
          </div>
        </div>
      </Router>
    );
  }
}

export default App;
